import React from 'react'
import { ContentCenter} from '../../styledComponents'
import {Progress} from './progressBar'

export const Layout = ({
    children
}) => {
    return(
       <ContentCenter>
           <Progress/>
               {children}
       </ContentCenter>
    )
}
